I Have a Wife - Capri Cavalli.wmv

Capri Cavalli is interested in her client not because he's married but because he's so young to be settling down. He's hitched to an older sugar-momma and hasn't experienced a younger and more energetic woman. Since Capri has him alone she decides to let him in on her little secret... under her skirt!!! 

